import React, { Component } from 'react';
import {Row,Col} from 'reactstrap';

class Stats extends Component {
    state = {  }
    render() { 
        return (
            <Row>
                <Col>
                    Str:
                </Col>
                <Col>
                    Dex:
                </Col>
                <Col>
                    Con:
                </Col>
                <Col>
                    Int:
                </Col>
                <Col>
                    Wis:
                </Col>
                <Col>
                    Cha:
                </Col>
            </Row>
        );
    }}
 
export default Stats;
